void drawBackground() {
	
	int base_y = 0;
	int base_x = 0;
	
	int curve_left = 80 * (curvature * 2);
	int curve_right = 80 * (curvature * 2);
	
	for (int y = 0; y < 120; y++) {
		for (int x = 0 + curve_left ; x < RES_X + curve_right; x++) {
			int loc = ((400 * y) + x);
			int color = background[loc];
			//printf("%d\n", background[loc]);
			if (color == 0) continue;
			draw_pixel(base_x + x - curve_left, base_y + y, color);
		}
		
	} 
	
}


void drawTime(float elapsedTime, int laps){
	char timeStr[10];
	sprintf(timeStr, "%.2f", elapsedTime);
	int base_y = 10;
	int base_x = 10;
	
	for (int i = 0; i < 4; i++){
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(letters[i][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		
		base_x += 10;
	}
	
	base_y += 10;
	base_x = 10;
	int indexNumber;
	
	for(int i = 0; i < strlen(timeStr); i++){
		if (timeStr[i] == '.'){
			indexNumber = 10;
		}
		
		else{
			indexNumber = timeStr[i] - '0';
		}
		
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(numbers[indexNumber][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		
		base_x += 10;
	}
	
	base_x = RES_X - 50;
	base_y = 10;
	
	for (int i = 4; i < 8; i++){
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(letters[i][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		
		base_x += 10;
	}
	
	
	// display laps
	base_x = RES_X - 50;
	base_y += 10;
	int ids[3] = {laps, 11, LAP_SIZE};
	
	for(int i = 0; i < 3; i++){	
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(numbers[ids[i]][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		base_x += 10;
	}
}

void drawSigns(int base_x, int base_y, int direction[]){
	// Center the sign
	base_x -= 10;
	base_y -= 10;
		
	float size = 20 * curRoadWidth * 2;
	if (size > 20) size = 20;
	float scaleFactor = size / 20;	
	
	
	if (scaleFactor == 0) return;
	
	
	for (int y = 0; y < size; y++) {
		for (int x = 0; x < size; x++) {
					
			int loc = ((20 * (int) (y / scaleFactor)) + (int)(x / scaleFactor));
			int color = direction[loc];
			if (color == 0) continue;
			
			int loc_x = base_x + x;
			int loc_y = base_y + y;
			
			// Check if in bounds
			if (loc_x < 0 || loc_x >= RES_X || loc_y >= RES_Y) continue;
			
			draw_pixel(loc_x, loc_y, color);
		}
	} 
}


// code for subroutines (not shown)
// Performs the buffer swap
void wait() {

	register int status;
	
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
		
}

bool in_bounds (int x, int y, int dx, int dy) {
	int tx = x + dx;

	int ty = y + dy;
	
	if (tx - 1 < 0 || tx + 1 >= RES_X || ty - 1 < 0 || ty + 1 >= RES_Y) {
		return false;
	}

	return true;	
}

// code not shown for clear_screen() and draw_line() subroutines
void clear_screen() {
	for (int x = 0; x < RES_X; x++) {
		for (int y = 0; y < RES_Y; y++) {
			plot_pixel(x, y, 0x0000);	
		}
	}	
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
	
	// First plot the boxes at the endpoints
	plot_box(x0, y0, line_color);
	
	bool is_steep = abs(y1 - y0) > abs(x1 - x0);
		
	if (is_steep) {
		int tempA = x0;
		int tempB = x1;
		
		// Swap
		x0 = y0;
		x1 = y1;
		
		y0 = tempA;
		y1 = tempB;
	}
	
	if (x0 > x1) {
		int tempA = x0;
		int tempB = y0;
		
		// Swap
		x0 = x1;
		y0 = y1;
		
		x1 = tempA;
		y1 = tempB;
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;
	int y_step = (y0 < y1) ? 1 : -1;
	
	for (int x = x0; x <= x1; x++) {
		if (is_steep) {
			plot_pixel(y, x, line_color);
		} else {
			plot_pixel(x, y, line_color);
		}
		
		error = error + deltay;
		if (error > 0) {
			y = y + y_step;
			error = error - deltax;		
		}
	}
}

void plot_box(int x, int y, short int color) {

	// endpoints of the box
	
	
	int x0 = x - 1;
	int x1 = x + 1;
	int y0 = y - 1;
	int y1 = y + 1;
	
	for (int i = x0; i <= x1; i++) {
		for (int j = y0; j <= y1; j++) {
			plot_pixel(i, j, color);	
		}	
	}	
}

void draw_pixel(int x, int y, short int line_color) {
	frame[y][x] = line_color;
}

void flush_frame() {

	for (int y = 0; y < RES_Y; y++) {
		for (int x = 0; x < RES_X; x++) {
			
			// Only draw if new
			if (loopCount > 0) {
				if (!bufferFlip) {
					if (prevFrame [y][x] != frame[y][x]) {
						plot_pixel(x, y, frame[y][x]);
					}
				} else {
					if (prevFramePrev [y][x] != frame[y][x]) {
						plot_pixel(x, y, frame[y][x]);
					}
					
				}
				
			}
			else {
				plot_pixel(x, y, frame[y][x]);
			}	
		}		
	}	
}

void plot_pixel(int x, int y, short int line_color) {
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}



